import React from "react";
import SearchBar from "./SearchBar";
import YouTube from "../APIs/YouTube";

class App extends React.Component {

  onValueSubmit = value => {
    YouTube.get('/search', {
      params: {
        q: value
      }
    })
  }

  render() {
    return (
      <div>
        <SearchBar onFormSubmit = { this.onValueSubmit }/>
      </div>
    )
  }
}

export default App;
